                    $score += 10;
                }
                if ($groupElement->matchesCity($label->city ?? '')) {
                    $score += 5;
                }
                if ($groupElement->matchesCountry($labelCountry ?? '')) {
                    $score += 5;
                }
                return $score;
            }
